module.exports = "<div *ngIf=\"language === 'hr'\" >\n    <div class=\"container-fluid\">\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Maroje Matana:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    odvjetnik,  osnivač i stariji partner, karijeru započeo kao sudac, nakon čega je upisan u Imenik odvjetnika Hrvatske odvjetničke komore 1989.g.  Bavi se pravom iz područja nekretnina, većinom vezano uz investicije i razvojne projekte, gdje je stekao značajno iskustvo, zatim infrastrukturalnim projektima, trgovačkim pravom i pravom društava, kao i drugim područjima građanskog prava, te javnim pravom. Iskusan je parničar.\n                </p>\n\n                <p>\n                    Maroje Matana je dopredsjednik, te član Upravnog i Izvršnog odbora Hrvatske odvjetničke komore s mandatom do 2021.g.\n                </p>\n\n                <p>\n                    Kontakt:  E-mail: <a href=\"mailto:ured@matana.org\" >ured@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Mirka Babić Delić:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    odvjetnica, osnivač i mlađi partner, upisana u Imenik odvjetnika Hrvatske odvjetničke komore 2009.g. Bavi se građanskim pravom, nekretninama, trgovačkim pravom, radnim, upravnim i ovršnim pravom, te pravom iz područja javne nabave, sa značajnim iskustvom u području javne nabave koja se sufinancira iz sredstava fondova Europske unije.\n                </p>\n\n                <p>\n                    Mirka Babić Delić član je Radne grupe za EU, AZTN, javnu nabavu, intelektualno vlasništvo i dr., pri Hrvatskoj odvjetničkoj komori, s mandatom do 2021.g.\n                </p>\n\n                <p>\n                    Kontakt:  E-mail: <a href=\"mailto:m.babic@matana.org\" >m.babic@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Matija Barić:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    odvjetnik, upisan u Imenik odvjetnika Hrvatske odvjetničke komore 2019. godine. Bavi se građanskim pravom, naknadom štete, ovršnim pravom, poreznim i upravnim pravom te pravom iz područja javne nabave.\n                </p>\n\n                <p>\n                    Kontakt:  E-mail: <a href=\"mailto:m.baric@matana.org\" >m.baric@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n    </div>\n</div>\n\n<div *ngIf=\"language === 'en'\" >\n    <div class=\"container-fluid\">\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Maroje Matana:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    Attorney-at-law, founder and senior partner; he began his career as a judge and was then registered in the Directory of Lawyers of the Croatian Bar Association in 1989. He practices real estate law, mostly in connection with investments and development projects where he has accumulated substantial experience, as well as infrastructural projects, commercial law, corporate law and other areas of civil law. He is an experienced litigator.\n                </p>\n\n                <p>\n                    Maroje Matana is Vice President and member of the Administrative and Executive Board of the Croatian Bar Association, his term to expire in 2021.\n                </p>\n\n                <p>\n                    Contact:  E-mail: <a href=\"mailto:ured@matana.org\" >ured@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Mirka Babić Delić:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    Attorney-at-law, founder and junior partner, registered in the Directory of Lawyers of the Croatian Bar Association in 2009. She practices civil law, real estate law, commercial law, labor, administrative and enforcement law, as well as public procurement law, with significant experience in procurement co-financed by European Union Funds.\n                </p>\n\n                <p>\n                    Mirka Babić Delić is member of  Workgroup for EU, Croatian Competition Agency, public procurement, intellectual property and other, in front of Croatian Bar Association, her term to expire in 2021.\n                </p>\n\n                <p>\n                    Contact:  E-mail: <a href=\"mailto:m.babic@matana.org\" >m.babic@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n        <div class=\"row\" >\n            <div class=\"col-xs-12 col-sm-3\" >\n                Matija Barić:\n            </div>\n\n            <div class=\"col-xs-12 col-sm-9\" >\n                <p>\n                    Attorney-at-law, registered in the Directory of Lawyers of the Croatian Bar Association in 2019. He practices in the area of civil law, damages, enforcement law, tax and administrative law, as well as public procurement law.\n                </p>\n\n                <p>\n                    Contact:  E-mail: <a href=\"mailto:m.baric@matana.org\" >m.baric@matana.org</a>\n                </p>\n            </div>\n        </div>\n\n    </div>\n</div>\n"

